  input: 'TEXT,F3XN,,"Explanation of the disbursement of funds ($20,000) paid in advance
    to the vendor.    On August 6, 2004 ProChoice Voter paid the vendor WCLA (Westchester
    Coalition for Legal Abortion) $20,000 on account for anticipated expenses to be
    incurred in connection with the 2004 General Election.  The actual cost of services
    provided by the vendor WCLA to ProChoice Voter relating to the 2004 General Election
    equaled $ 20,059.54.  Of the $20,059.54:  A. $13,054.54 was the cost of a newsletter.  Of
    that amount, $5,988.67 was independednt expenditures as reported on line 24 and
    line 21 b.   In addition, the amount of $1,069.07 was an  in-kind  contribution
    and was reported on line 23, with memo attached. B. Two additional independent
    expenditures were made totaling $2,005.00. They  were also reported on line 24
    and line 21 b.   C.  $5,000 was the cost of the use of the WCLA database.  Check
    #206, dated 11/22/2004, for the amount of $59.54, was paid to WCLA for expenses
    incurred over the initial payment of $20,000."'
